import React from "react";
function List() {
  return (
    <ul className="list-group">
      <li className="list-group-item">
        <input type="checkbox" id="facebook"/>
      <label for="facebook"> facebook</label></li>

      <li>ilusterator</li>
      <li>writting</li>
      <li>reading</li>
    </ul>
  );
}
export default List
